    "no lowering": {                                  "en": "no lowering",                                      "de": "keine Tieferlegung",                               "ru": "без снижения",                                     "pt": "sem rebaixamento",                                 "nl": "geen verlaging",                                   "fr": "pas d'abaissement",                                "it": "nessun abbassamento",                              "es": "sin bajar",                                        "pl": "bez obniżania",                                    "uk": "без опускання",                                    "zh-cn": "不降低"},
